  loggedInFlag
});

export const dispatchGetAllBuckets = () => {
  return function(dispatch, getState) {
    axios.get('http://localhost:8011/getAllBuckets').then((data)=>{
      dispatch(data)
    }).catch((error)=>{
      console.log(error)
    })
